import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBook, faFileAlt, faHome, faUniversity } from '@fortawesome/free-solid-svg-icons';
import { Link } from 'react-router-dom';

export default function Navbar() {
  return (
    <nav className="bg-blue-600 text-white p-4 shadow-md">
      <div className="flex justify-between items-center max-w-7xl mx-auto">
        <h1 className="text-2xl font-bold">
          <FontAwesomeIcon icon={faUniversity} className="mr-2" />
          SPU Study Portal
        </h1>
        <ul className="flex gap-4">
          <li><Link to="/" className="hover:underline"><FontAwesomeIcon icon={faHome} className="mr-1" />Home</Link></li>
          <li><Link to="/departments" className="hover:underline"><FontAwesomeIcon icon={faBook} className="mr-1" />Departments</Link></li>
         
        </ul>
      </div>
    </nav>
  );
}
